      <h1>แม่นปืนสาวไทยเก็บเหรียญทองปืนสั้นอัดลม 10 เมตร</h1>
      <address>
        <time datetime="2019-12-09T14:34:00+00:00">09 Dec 2019, 14:34</time>
      </address>
      <p>เณศรา จำปารัตน์ นักแม่นปืนสาวทีมชาติไทย คว้าเหรียญทองปืนสั้นอัดลมหญิง ระยะ 10 เมตร กีฬาซีเกมส์ 2019 ที่ฟิลิปปินส์ มารีน คอร์ปส์ ไฟริง เรนจ์ กรุงมะนิลา ประเทศฟิลิปปินส์ เมื่อวันที่ 9 ธ.ค.2562 ที่ผ่านมา</p>
    </article>
